import React from 'react';
import { makeStyles } from "@material-ui/core/styles";
import { Card } from 'antd';
import { List, Avatar } from 'antd';

const useStyles = makeStyles((theme) => ({

}));

export default function RestaurantRecommend() {
    const classes = useStyles();
    const data = [
        {
            title: 'Ant Design Title 1',
        },
        {
            title: 'Ant Design Title 2',
        },
        {
            title: 'Ant Design Title 3',
        },
        {
            title: 'Ant Design Title 4',
        },
    ];
    var avatarImg = "https://chatscope.io/storybook/react/static/media/zoe.e31a4ff8.svg";
    return (
        <Card size="small" title="Restaurant đề xuất" style={{ width: '100%' }}>
            <List
                itemLayout="horizontal"
                dataSource={data}
                renderItem={item => (
                    <List.Item>
                        <List.Item.Meta
                            avatar={<Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />}
                            title={<a href="https://ant.design">{item.title}</a>}
                            description="Ant Design, a desig"
                        />
                    </List.Item>
                )}
            />
        </Card>
    );
}
